        "Desc": {
            "CH": "由水凝聚成的初具人形的魔物。\n曾有无数的意志消融在水中，但水中原本就与宇宙一样充满了渴求被诞下的灵魂。被称为水形幻人的新生儿究竟是前者还是后者是难以分辨的；但两者之间的区别并没有人们所想象的那么大：太阳不会区分、时光不会区分、翻涌的潮水不会区分，渗透一切的黑暗也不会区分。",
            "EN": "A humanoid monster formed from the agglomeration of water.\nCountless wills dissolved in the water, which, like the universe, was full of souls that wished to be born. Are the newborn Hydro Tulpas from the former or the latter? They're not as different as we'd like to think, anyway. The sun can't distinguish them, and neither can time, the surging tides, or even the darkness that permeates everything."
        },
