            "EN": "- Summons a Half-Tulpa every 15s. Half-Tulpas can be destroyed by Elemental Reactions.<br>- During combat, will attempt to absorb Half-Tulpas to enter Rage State: <b>All RES increased by 45%, and greatly boosts DMG dealt. Rage lasts for one skill.</b><br>- Abyss Version: <b>First Absorb will be used later, while first Rain of Blades will be used earlier. In Rage state, will use 2 skills consecutively, with 0 interval.</b>"
