            "CH": "尽管枫丹动能工程科学研究院是最为主要的发条机械研究与设计机构，坊间也有许多不隶属于科学院的工程师与独立工坊。\n这种机械起初是为一名独立工程师为纪念情人及赞助者而设计制造的。它最终被执律庭选中并采购作为城市安全或称公共暴力机构的武器之一。",
            "EN": "Although the Fontaine Research Institute of Kinetic Energy Engineering is the main organization involved in clockwork meka research and design, there are also many independent engineers and workshops that are not affiliated with the Research Institute.\nThe first ever machine of this type was designed by an independent engineer to commemorate their lover and sponsor. In the end, it was acquired by the Maison Gardiennage as a tool to uphold municipal security – or, in the eyes of some, as a weapon to administer public violence."
