            "CH": "与「侦察记录型」一样，是最早设计制造的新式发条机关机械之一（数百年后的如今已经无人将其称为「新式」。这在当时是用以区分传统发条势能动力的机械机关用的说法）。\n名称是用来纪念发明者的友人而起的，最初设计的目的是帮助人。但后来的使用者普遍认为用它攻击人较之用人攻击人的相对优势更大。",
            "EN": "Alongside the Recon Log Mek, this was one of the first new-type clockwork meka to be made (though of course, after hundreds of years, no one refers to them as \"new-type\" anymore – this was simply to differentiate them from traditional clockwork mechanisms that were powered by potential energy.)\nIt was named to commemorate a friend of its inventor, and was originally designed to help people. However, its ability to attack people – thereby avoiding the need to put friendly personnel at risk – subsequently came to be seen as its real strength."
