    "40701": {
        "_id": 40701,
        "KingdomID": 4,
        "ClassID": 10407,
        "Name": {
            "CH": "冰风组曲 · 科培琉司的劫罚",
            "EN": "Icewind Suite: Nemesis of Coppelius"
        },
        "Title": [
            {
                "CH": "冰风组曲 · 阳面",
                "EN": "Icewind Suite: Duality, Side B"
            }
        ],
        "Desc": {
            "CH": "由枫丹科学院研发的奇械舞者。\n在博絮埃最初的设想中，奇械舞者是超越机械复制时代的艺术品。但在博絮埃被迫离任后，该项目改由梅雅德接手。梅雅德对于奇械和舞者均有自己独到的见解，因此在迭代过程中，奇械舞者的各项功能在臻于完备的同时，也逐渐偏离了博絮埃的设计初衷。\n\n来自枫丹精密发条机关的华丽演出，这一幕的主角为发条机关贵族「科培琉司」。\n在演出的高潮阶段，科培琉司将停留在舞池的中央，露出能源特征为芒性的奇械发条，极大提升出力效率，为自己施加护罩，产生劫罚的三枚霜心。\n在这一阶段借由荒性的攻击，能有效破除护罩，并最终使其供能过载，推进演出流程。",
            "EN": "Artificed Dancers developed by the Fontaine Research Institute.\nBossuet originally intended for Artificed Dancers to be works of art that transcended the era of mechanical reproduction. But after Bossuet was forced to resign, the project was taken over by Maillardet, who had his own unique understanding of what he wanted to achieve. As a result, while their features were perfected during the course of its development, the Artificed Dancers gradually strayed from Bossuet's original vision.\n\nNext up is a fantastical performance to be delivered by the clockwork meka Coppelius. \nAt the climax of the performance, Coppelius will halt at the center of the dance floor and expose his spare clockwork component charged with Pneuma, thereby drastically increasing the efficiency of his exertions, granting him a shield, and generating three retributive Frosthearts. \nDuring this phase, using Ousia-imbued attacks will effectively break his shield, thus progressing the performance."
        },
        "Color": "Ice",
        "HP": 7.5,
        "HPCurve": 2,
        "ATK": 5.0,
        "ATKCurve": 4,
        "RESBase": {
            "Ice": 0.7,
            "Wind": 0.7
        },
        "RESState": [
            {
                "State": "Alert",
                "All": 3.0
            }
        ],
        "Ball": {
            "Type": 0,
            "Point": 4,
            "Drop": "3336"
        },
        "Icon": [
            "UI_MonsterIcon_MachinaIustitia_Nutcracker"
        ],
        "Grade": 3,
        "Weight": 300,
        "EndureTemplateID": 4000,
        "Tutorial": {
            "CH": "- 科培琉司是演出《冰风组曲 · 科培琉司的劫罚》的主角，演出会在30s后（或血量降至71%后）进入高潮。<br>- 演出进入高潮时，科培琉司会移动到舞台中央，产生劫罚的三枚霜心，并在每个乐段开启时为自己刷新8元素量冰盾。<br>- <b>使用1次荒性攻击</b>可以直接湮灭其护盾。<b>累计使用3次荒性攻击</b>可提前结束高潮。<br>- 若未提前结束，高潮会在3个乐段后自行结束，每个乐段时长12秒。结束后30s会再次进入高潮。",
            "EN": "- Coppelius is the main character of the performance <i>Icewind Suite: Nemesis of Coppelius</i>. The performance reaches it climax after 30s or after HP falls below 71%.<br>- At the climax of the performance, Coppelius will move to the center of the stage and summon three Frosthearts of Retribution. At the start of every section of the climax, he refreshes an 8U Cryo Shield.<br>- <b>Attacking him with Ousia 1 time</b> will annihilate his Shield. <b>Attacking him with Ousia 3 times</b> will terminate the climax.<br>- If not terminated, the climax will finish after 3 sections. Each section lasts for 12s. The next climax starts 30s after the previous one finishes."
        },
        "Csx": [
            "ECAutomatons/冰风组曲·科培琉司的劫罚"
        ]
    },
