            "CH": "由枫丹科学院研发的奇械舞者。\n在博絮埃最初的设想中，奇械舞者是超越机械复制时代的艺术品。但在博絮埃被迫离任后，该项目改由梅雅德接手。梅雅德对于奇械和舞者均有自己独到的见解，因此在迭代过程中，奇械舞者的各项功能在臻于完备的同时，也逐渐偏离了博絮埃的设计初衷。\n\n来自枫丹精密发条机关的华丽演出，这一幕的主角为发条机关女郎「歌裴莉娅」。\n在演出的高潮阶段，歌裴莉娅将停留在舞池的中央，露出荒性的奇械发条，极大提升出力效率，召来葬送的无数旋风。\n在这一阶段借由芒性的攻击，能有效削弱其攻击能力，并最终使其供能过载，推进演出流程。",
