        "ClassID": 10541,
        "Name": {
            "CH": "镀金旅团 · 炽沙叙事人",
            "EN": "Eremite Scorching Loremaster"
        },
        "Title": [
            {
                "CH": "编织烈焰与史诗的神谕",
                "EN": "Augury of the Foretold Flame"
            }
        ],
        "Desc": {
            "CH": "从沙漠中走出的松散佣兵团体中的一员。即使为了报酬愿意为任何人效力，也不会忘记沙海中的根源。\n在文明崩解之后，沙漠中的故事如同风中的火星、云中的雨一样，是经由口口相传的诗与秘史一代又一代继承下去的。在流传的过程中有许多故事变化了，又有许多故事失落了。\n「镀金旅团」是无知或是怀着蔑视的心不去区分沙海中诸多部族的外人对他们的统称。在被称为镀金旅团的人当中，有许多人已经忘记了沙漠的故事。如今仍然能记起许多故事的人，是不会背叛流淌在体内的沙漠血脉的。",
            "EN": "A person hailing from the loosely-organized mercenary bands of the desert. Even though they will work for anyone as long as the pay is good, they will never forget their roots in the Great Red Sand.\nAfter the collapse of its civilizations, the stories of the desert were passed down generation after generation in oral tradition just like the sparks in the wind and the rain in the clouds. As time passed, some stories were lost while others survived, albeit with significant changes.\n\"The Eremites\" is the umbrella term given to the tribes of the desert by those too ignorant or disdainful to learn the tribes' myriad differences. Within those referred to as the Eremites, many have also indeed already forgotten the tales of the desert. Fear not, however, for those who still remember will never betray the spirit of the sands yet flowing through their veins."
        },
