            "EN": "A vishap that dwells deep beneath the abyssal depths. Due to the social division of labor, it has manifested a form aligned with the Electro element.\nFollowing the demise of the Ancient Seven Sovereigns, a new generation of Sovereigns is presently being born. But now that the Bathysmal Vishaps have evolved in this manner, they have lost their purity. As such, the Dragon of Water will no longer be born from among their ranks. Prophecy holds that the new Dragon of Water will descend in the form of a human...\nThough the Dragons of Water that have returned to their complete form still see them as one of their own, they are closer to another race. Perhaps they figured that it is better to be closer to humans, since they chose to work with them, or perhaps they see their potential..."
