        "Desc": {
            "CH": "栖息在沉玉谷山林间的凶猛野兽，因其深色的纹理而得名「玄文」。\n沉玉谷本地的民话中，在遥远的过去，这些猛兽曾是某位仙人的眷属，降妖伏魔、庇护一方，在仙人故去后，方才退化为凶暴的野兽。传说早已无从查考，仙人的身份也众说纷纭，唯一可以确定的是，出于安全考虑，最好还是不要贸然靠近这些暴躁的生灵。\n千年间，伴随着人类不懈的开拓，原本属于这些野兽的生存空间变得越来越小。时至今日，只有在沉玉谷人迹罕至的崇山峻岭中，才能偶尔看到这些猛兽的身影…",
            "EN": "Xuanwen Beasts, named for the dark patterns on their bodies, are fierce creatures that inhabit the mountains of Chenyu Vale.\nIn the region's folklore, these beasts were the servants of an adeptus in ancient times, tasked with vanquishing evil and protecting the region. However, they devolved into brutal creatures after said adeptus passed away. These legends cannot be verified, and no one knows the true identity of this adeptus. This much is for sure, however — one should stay away from these aggressive creatures for one's safety.\nFor over a thousand years, these beasts have lost a tremendous amount of territory that once belonged to them to relentless human encroachment. These days, they can only occasionally be spotted in the remote mountains of Chenyu Vale..."
        },
