        "ClassID": 10903,
        "Name": {
            "CH": "「公子」一阶段",
            "EN": "Childe P1"
        },
        "Title": [
            {
                "CH": "愚人众执行官末席",
                "EN": "Eleventh of the Fatui Harbingers"
            }
        ],
        "Desc": {
            "CH": "愚人众执行官第十一席，「公子」达达利亚。\n自不祥的「邪眼」之中汲取力量，以至暗之地习得的武艺战斗。\n\n拥有无穷争斗欲望的纯粹战士。\n每次浴血的纷争、每场生死攸关的挑战，于他而言皆是快意试炼。\n人皆言年轻的「公子」战绩远近闻名。\n但他本人却对这种大话从来不以为然。\n\n毕竟…\n<i>「你的命运将成为纷争的风暴之眼，</i>\n<i>「铁剑交错的声响是常伴你的奏乐。</i>\n<i>「踏入至暗之处的漆黑记忆，</i>\n<i>「终将成为你颠覆世界的力量吧。」</i>",
            "EN": "\"Childe\" Tartaglia, Eleventh of the Fatui Harbingers.\nHe draws power from the ominous Delusion he possesses and fights using martial arts that he learned in a land of darkness.\n\nHe is a pure warrior with an insatiable lust for battle.\nEach bloody conflict, each life-and-death struggle is a delightful trial to him.\nPeople say that the young Childe is famed throughout the land for his battle prowess.\nBut he has never taken big talk of this kind to heart.\n\nAfter all...\n<i>\"You shall ever be the eye of the storm,</i>\n<i>\"And the clashing of steel shall ever accompany you.</i>\n<i>\"The pitch-black memory of stepping into uttermost darkness,</i>\n<i>\"Shall, at last, become the strength by which you will overturn this world.\"</i>"
        },
        "Color": "Water",
        "HP": 6.0,
        "HPCurve": 1,
        "ATK": 10.0,
