        "Title": [
            {
                "CH": "雷电之稻妻殿",
                "EN": "Raiden no Inazuma Tono"
            }
        ],
        "Desc": {
            "CH": "代行雷电将军权能的人偶，在对抗威胁「永恒」之敌时展现出的形态。\n作为雷电影践行「永恒」的协助者，她从未质疑，亦无畏惧，一直以来全力以赴，心无杂念。\n她曾听闻在真与影的时代，影承担着与她类似的责任，经历了诸多惨痛失去。\n当两个影子交叠为一时，她却只能看见在「她」本应永恒的意志上留下的无数细密的凿痕吧。既然命运注定是一场轮回，就如约定那样，向其宣战吧。\n\n<i>「此身，象征无上威严，被授予统领一国之权，凝聚了『雷电将军』的一切。</i>\n<i>「自然也继承了影前行时不断失去的痛苦，以及，想要抵达永恒的决心。</i>\n<i>「决心、勇气、爱慕、仇恨…都会在时间长河中变质扭曲。</i>\n<i>「唯有『法则』永恒不变。」</i>",
            "EN": "This is the form that the puppet that inherited the Raiden Shogun's authority takes when she is opposing those who threaten Eternity.\nAs the Raiden Shogun's assistant in pursuing eternity, she has never doubted, never felt fear, never given anything less than her best, never been disturbed by idle thoughts.\nShe once heard about how Ei had shouldered a similar duty when Makoto was also present, suffering much agonizing loss in the process.\nWhen the two shadows overlapped once more, however, she could only see the countless fine fractures in what should have been \"her\" eternal will. Since fate is destined for cyclicality, she must fulfill her promise and declare war on \"her.\"\n\n<i>Mine is the most supreme and noble form. Power over the realm has been vested within me, and I am the essence of all that is the \"Raiden Shogun.\"</i>\n<i>\"Naturally, I have also inherited the pain of Ei's countless losses and her will to attain Eternity.</i>\n<i>\"Resolve, valor, love, hate... They will all twist in the river of time.</i>\n<i>\"But the 'rules' will never change.\"</i>"
        },
