    "90901": {
        "_id": 90901,
        "KingdomID": 9,
        "ClassID": 10909,
        "Name": {
            "CH": "吞星之鲸",
            "EN": "All-Devouring Narwhal"
        },
        "Title": [
            {
                "CH": "无光星海彼端的访客",
                "EN": "Visitor From the Far Side of the Sea of Stars"
            }
        ],
        "Desc": {
            "CH": "神秘的异界巨兽。\n诗人常将星空比做海洋。他们见过或是梦见过无月的漆黑海面上闪着磷光的无数浮游生物，状似银河；又或者是洒落在海面上的月光被波浪绞碎，就如同闪烁的星光。在最魔幻的故事里或是最疯癫的诳语中，宇宙深处真正的星辰或许也如提瓦特一般充满了生机，而宇宙本身就如同海洋。但从现实的角度来看，假若存在深邃的、充满了生命的宇宙，为何这些生命至今也未与提瓦特人进行接触呢？\n或许宇宙渗入提瓦特的过程从未停止；也许更高的意志为它划定了边界是为了保护这个世界。",
            "EN": "A mysterious and gargantuan creature from another world.\nPoets often liken the starry sky to the ocean. They've seen or dreamt of countless bioluminescent plankton floating on a moonless sea, resembling a galaxy, or the moonlight ripped apart by waves on the sea's surface, like shimmering stars. In the most fantastical stories or outrageous lies, the stars found in the depths of the cosmos might be teeming with life, much like Teyvat, and the universe itself is akin to an ocean. Realistically speaking, however, if a profound universe full of life exists, why hasn't any of that life made contact with Teyvat?\nMaybe the universe has been constantly trying to infiltrate Teyvat, or maybe a higher power created borders to protect this world."
        },
        "Color": "Water",
        "HP": 20.0,
        "HPCurve": 2,
        "ATK": 10.0,
        "ATKCurve": 4,
        "RESBase": {
            "Water": 0.7
        },
        "Icon": [
            "UI_MonsterIcon_Ptahur_Devourer"
        ],
        "Grade": 4,
        "Weight": 20000,
        "EndureTemplateID": 4000,
        "MultiPlayerID": 103,
        "Tutorial": {
            "CH": "- 本体具有怒气条，<b>积攒至120点时将会吞噬角色，进入神秘空间</b>；此时无法对本体造成伤害。击败神秘空间内的「幻影」，会离开神秘空间，并<b>使本体损失20%生命值</b>，为所有角色恢复100点元素能量。<br>- 本体在战斗中每秒会积攒1点怒气，战斗80秒后将改为每秒积攒2点。本体受到伤害时，每失去1%生命值，将会积攒1点怒气。破坏「涡眼」将积攒30点怒气。<br>- 会周期性召唤「涡眼」：持续牵引角色，并对角色造成大量伤害。累计对其进行8次攻击，或<b>使用1次荒性或芒性攻击</b>，方可破坏涡眼。<br>- 神秘空间中的「幻影」具有本体60%的生命值，并会发动强大的攻击。在合适的时机<b>使用1次荒性或芒性攻击</b>，可使幻影<b>损失25%生命值</b>并短暂瘫痪。",
            "EN": "- The BOSS accumulates Rage during combat. <b>When Rage reaches 120, will devour you, taking you to another realm</b>. To return to reality, you must defeat the Phantom inside the realm. Upon defeating the Phantom, the BOSS will <b>lose 20% HP</b>, and every party member revives 100 Elemental Energy.<br>- The BOSS gathers 1 Rage every second; after 80 seconds, will instead gather 2 Rage every second. Each time it takes damage, every 1% HP lost will increase Rage by 1. Destroying an Eye of Maelstrom will gather 30 Rage.<br>- Eyes of Maelstrom will appear in battle, pulling characters in and dealing massive DMG. To destroy it, either attack it 8 times, or <b>attack it once with Ousia or Pneuma</b>.<br>- The Phantom in the other realm has 60% HP of the BOSS, and will unleash powerful attacks. <b>Correctly timed Ousia or Pneuma attacks</b> will paralyze it and cause it to <b>lose 25% HP</b>."
        },
        "Csx": [
            "ECEnemiesOfNote/吞星之鲸",
            "ECEnemiesOfNote/吞星之鲸·幻影"
        ]
    },
